import '../common/styles/common.scss';
import Footer from '../components/ui/Footer/Footer';
import AppLayout from '../components/layouts/AppLayout/AppLayout';

export const App = ({Component, pageProps}) => {
    return (
    <>
        <AppLayout>
            <Component {...pageProps} />
        </AppLayout>
    </>
    )
}

export default App;
